Analog-to-Digital Converters (ADCs) work by sampling an analog voltage signal and converting it to a digital number that represents the magnitude of the analog signal. This digital representation is what the processor works with. Here’s how it works in practice on the BBB: Analog Voltage Input : The ADC reads an analog input voltage on one of its channels. Digital Representation : The ADC converts this voltage to a digital value between 0 and 4095. A value of 0 corresponds to 0V, and a value of 4095 corresponds to 1.8V. Voltage-to-Digital Conversion Formula : The conversion from raw ADC reading to voltage can be calculated using the formula: \[ \text{Voltage (V)} = \frac{\text{ADC Reading}}{4095} \times 1.8 \] ADC Reading : The raw value read from the in_voltageX_raw file. 1.8 : The reference voltage (1.8V), which is the maximum input voltage that the ADC can read without damage. Read the Raw ADC Value : Let's assume we want to read from ADC Channel 0. First, navigate to the appropriate directory and read the value: $ cd /sys/bus/iio/devices/iio:device0
$ cat in_voltage0_raw Suppose the command returns a value of 2048. Convert the Raw Value to a Voltage : Use the formula mentioned earlier to convert the raw ADC value to a voltage: \[ \text{Voltage (V)} = \frac{2048}{4095} \times 1.8 = 0.9 , \text{V} \] This means the analog signal at ADC Channel 0 corresponds to a voltage of approximately 0.9V. 5. List Available ADC Channels The BeagleBone Black (BBB) allows you to interact with its Analog-to-Digital Converter (ADC) through the sysfs interface, located at /sys/bus/iio/devices/iio:device0. This directory contains various files and subdirectories that provide access to the ADC hardware and its configuration. Below is an explanation of each file and subdirectory you might see when you run ls in this directory: $ cd /sys/bus/iio/devices/iio:device0
$ ls -l
buffer in_voltage0_raw in_voltage2_raw in_voltage4_raw in_voltage6_raw name power subsystem
dev in_voltage1_raw in_voltage3_raw in_voltage5_raw in_voltage7_raw of_node scan_elements uevent Explanation of Files and Directories : buffer Purpose : This directory contains files related to buffer management for the ADC. Usage : Buffering is typically used in applications requiring continuous data sampling (like high-frequency sensor data collection). Configuring the buffer allows you to read multiple samples at once, which is more efficient than reading single samples one at a time. Details : This directory is often used in advanced applications where high-speed data acquisition is needed. in_voltageX_raw (e.g., in_voltage0_raw, in_voltage1_raw, ... in_voltage7_raw) Purpose : These files represent the raw ADC values read from the corresponding ADC channels (0 through 7). Values : Reading from these files returns an integer representing the digital conversion of the analog signal present on the corresponding ADC pin. Usage : You can use the cat command to read the raw ADC value from a specific channel: $ cat in_voltage0_raw Details : The raw value is typically between 0 and 4095 for a 12-bit ADC, representing the analog voltage scaled between 0V and the reference voltage (1.8V on the BBB). name Purpose : This file provides the name of the ADC device. Usage : Reading this file returns a string that typically identifies the ADC controller's driver name, which might look something like TI-am335x-adc. Details : Knowing the driver name can help in debugging or configuring specific driver-related parameters. dev Purpose : This file represents the device number assigned to the ADC by the Linux kernel. Details : This is typically used internally by the kernel and device management systems to handle device nodes and their associations. of_node Purpose : This directory represents the device tree node associated with the ADC hardware. Details : The device tree is a data structure that describes the hardware components of the system to the operating system. The of_node directory can contain properties that reflect how the hardware is described in the device tree source. Usage : Typically used for debugging or understanding hardware configuration, not usually modified by end-users. power Purpose : This directory contains power management files for the ADC device. Usage : You can use the files within this directory to manage the power state of the ADC. For example, some systems might allow you to enable or disable the ADC to save power when it's not in use. Details : This is often used in power-constrained environments where the ADC might be turned off to save energy. scan_elements Purpose : This directory contains files related to configuring scan elements for buffered readings. Usage : In applications where multiple channels are read in a scan sequence (multi-channel ADC reads), this directory is used to configure which channels are included in the scan and in what order. Details : This is advanced functionality typically used in applications requiring synchronized sampling of multiple inputs. subsystem Purpose : This is a symbolic link pointing back to the subsystem the device belongs to, in this case, the IIO (Industrial I/O) subsystem. Details : This link provides context within the broader sysfs tree, showing how devices are organized under different subsystems (like GPIO, IIO, etc.). Usage : Generally used by system software for managing device trees and hierarchies. uevent Purpose : This file is used by udev, the device manager for the Linux kernel, to manage dynamic device nodes. Usage : When read, this file provides environment variables for udev events, allowing you to see or modify the device's event handling configuration. Details : This is typically managed automatically and not frequently modified by users. 6. Making a ADC C Library Create a new directory called adc in home with the following files: $ mkdir adc && cd && touch adc.c && touch adc.h && touch MakeFile Edit the adc.h file: Suppressed Code here [24 lines]... #i