} Much like the GPIO library we can build libraries manually, compile adc.c into an Object File by Using the following command to compile adc.c into an object file (adc.o): $ gcc -c adc.c -o adc.o Create a Static Library (libadc.a) to create a static library, use the ar command: $ ar rcs libadc.a adc.o Command Breakdown: ar: The archiver tool used to create and maintain library archives. rcs: Flags where r inserts the files into the archive, c creates the archive if it doesn't exist, and s creates an index for quick symbol lookup. libadc.a: The name of the static library being created. adc.o: The object file to be included in the library. Explanation: What is a Static Library? A static library is a collection of object files that are linked into the final executable at compile time. Once linked, the code from the static library becomes part of the executable binary. This means that the executable will carry a copy of the library's code, making it self-contained and independent of the library file after compilation. Create a Shared Library (libadc.so) to create a shared library, use the following gcc command: $ gcc -shared -o libadc.so adc.o Command Breakdown: -shared: Tells gcc to produce a shared library. -o libadc.so: Specifies the output filename for the shared library. adc.o: The object file to be included in the library. Explanation: What is a Shared Library? A shared library, on the other hand, is not linked into the final executable at compile time. Instead, it is loaded into memory at runtime. Multiple programs can share a single copy of a shared library, which can save memory and allow updates to the library without recompiling the programs that use it. Install the Header and Library Files System-Wide. You could manually copy the header file to /usr/include and the libraries to /usr/lib, or skip to the next section and create a Makefile to do it for you each time. $ sudo cp adc.h /usr/include/
$ sudo cp libadc.a /usr/lib/
$ sudo cp libadc.so /usr/lib/
$ sudo ldconfig # Update the shared library cache We can do this using a Makefile aswell, edit the Makefile: Suppressed code here [43 lines]... # Variables
